function Text() {
    const client = "Designer"
    const title = {
        graphic: "Graphic",
        web: "Programming"
    }
    return(
        <div>
        <p>
            {client == "Designer" ? <span style={{color: "red"}}>{title.graphic}</span> : title.web} and web design are two areas that are often confused with each other. After all, they both focus on ‘design’ and they both often work on the same projects. 
        </p>
      </div>
    );
}

export default Text
